import React ,{memo,useEffect,useState} from 'react'
import Button from '../atoms/Button';
import Image from '../atoms/Image';
import Card from '../molecules/Card';
const Home = memo(()=>{
    const CLIENT_ID = '0Z-LBq4hNinGRglNGQpYef33VyodRl1K012Ai9dJd18';
    const URL = `https://api.unsplash.com/photos/random/?client_id=${CLIENT_ID}`

    const [data,changeData] = useState();

    useEffect(()=>{
        fetch(URL)
        .then(res => res.json())
        .then(data => changeData(data))
        changeData(data);
    })

return(
<>
{data && data.forEach((item)=>{
<Card>
    <Image href={item.urls.regular} height={300} width={300}/>
        <Button onclick={item.urls.links.download} text='View Full'/>

</Card>
})}
</>
)
})
export default Home;
